import React from "react";
import "./All.css";
import Gallerynav from "./gallerynav";
import Painting from "./Painting";
import Sculpture from "./Sculpture";
import { onepaint, twopaint, threepaint, fourpaint } from "./Painting";
import { onesculp, twosculp, threesculp, foursculp } from "./Sculpture";
import Navbar from "./Navbar";

const All = () => {
  return (
    <div classname="navbar">
      <Navbar></Navbar>
      <div>
        <Gallerynav />
        {/*<button type="button" class="btn" onclick = {()=>{}}>âš™</button>*/}
        <div class="grid-container">
          <div class="grid-item">
            {onepaint}
            
          </div>
          <div class="grid-item">{twopaint}</div>
          <div class="grid-item">{threepaint}</div>
          <div class="grid-item">{fourpaint}</div>
          <div class="grid-item">{onesculp}</div>
          <div class="grid-item">{twosculp}</div>
          <div class="grid-item">{threesculp}</div>
          <div class="grid-item">{foursculp}</div>
        </div>
      </div>
    </div>
  );
};

export default All;
